import { Injectable} from '@angular/core';
import {Subject} from 'rxjs';
import {Recipe} from './recipe.model';
import {Ingredients} from '../shared/ingredient.model';
import { Store } from '@ngrx/store';
import * as ShoppingListActions from '../shopping-list/store/shopping-list.action';
import * as fromShoppingList from '../shopping-list/store/shopping-list.reducer';
@Injectable({
  providedIn: 'root'
})
export class RecipeService {
  recipesChanged = new Subject<Recipe[]>();
  // private recipes: Recipe[] = [
  //   new Recipe('One',
  //     'New text here',
  //     'data:image/jpeg;base64,',
  //     [
  //       new Ingredients('ccds', 4),
  //       new Ingredients('weewee', 5)]),
  //   new Recipe('Two', 'New two', 'data:image/jpeg;base64,',
  //     [
  //       new Ingredients('aaaa', 3),
  //       new Ingredients('vvvvv', 2)]),
  //   new Recipe('Three', 'New three', 'data:image/jpeg;base64,',
  //     [
  //       new Ingredients('ffff', 3),
  //       new Ingredients('sdcsf', 1)]),
  // ];
  private recipes: Recipe[] = [];

  constructor(private store: Store<fromShoppingList.AppState>) { }
  // tslint:disable-next-line:typedef
  setRecipes(recipes: Recipe[]){
    this.recipes = recipes;
    this.recipesChanged.next(this.recipes.slice());
  }
  getRecipes(){
    return this.recipes.slice();
  }
  // tslint:disable-next-line:typedef
  getRecipe(index: number){
    return this.recipes[index];
  }
  // tslint:disable-next-line:typedef
  addIngredientsToShoppingList(ingredients: Ingredients[]){
    this.store.dispatch( new ShoppingListActions.AddIngredients(ingredients))
  }
  // tslint:disable-next-line:typedef
  addRecipe(recipe: Recipe){
    this.recipes.push(recipe);
    this.recipesChanged.next(this.recipes.slice());

  }
  // tslint:disable-next-line:typedef
  updateRecipe(index: number, newRecipe: Recipe){
    this.recipes[index] = newRecipe;
    this.recipesChanged.next(this.recipes.slice());
  }
  // tslint:disable-next-line:typedef
  deleteRecipe(index: number){
    this.recipes.splice(index, 1);
    this.recipesChanged.next(this.recipes.slice());
  }
}
